create table alarm_record
(
    alarm_record_id    bigint auto_increment
        primary key,
    message            varchar(255)     null,
    success_count      int    default 0 null,
    today_alarm_record datetime         null,
    total_count        int    default 0 null,
    total_wake_up_time bigint default 0 null,
    member_alarm_id    bigint           not null,
    constraint FK8qurme6l4uxtomcyvhslh06x8
        foreign key (member_alarm_id) references member_alarm (member_alarm_id)
);

